import React from "react";

export default function Navbar() {
  return (
    <header className="w-full py-4 px-8 fixed top-0 left-0 bg-white/60 backdrop-blur-xl shadow-soft-lg z-50">
      <nav className="max-w-6xl mx-auto flex items-center justify-end gap-10 text-neutral-700">
        {[
          { name: "Home", id: "home" },
          { name: "About", id: "about" },
          { name: "Skills", id: "skills" },
          { name: "Projects", id: "projects" },
          { name: "Certifications", id: "certifications" },
          { name: "Contact", id: "contact" },
        ].map((item) => (
          <a
            key={item.id}
            href={`#${item.id}`}
            className="hover:text-lavender-400 font-medium transition text-sm"
          >
            {item.name}
          </a>
        ))}
      </nav>
    </header>
  );
}
